CREATE TABLE EMPLOYEES(
EMPLOYEE_ID VARCHAR(30),
EMPLOYEE_FNAME VARCHAR2(30),
EMPLOYEE_LNAME VARCHAR2(30),
EMPLOYEE_SALARY NUMBER (10),
EMPLOYEE_JOB VARCHAR2(30),
EMPLOYEE_AGE NUMBER(2),
EMPLOYEE_SEX VARCHAR2(6),
EMPLOYEE_PNUMBER varchar2(30),
MANAGER_ID VARCHAR(30),
CONSTRAINT EMPLOYEE_ID_PK PRIMARY KEY(EMPLOYEE_ID),
CONSTRAINT EMPLOYEE_FNAME_NN CHECK(EMPLOYEE_FNAME IS NOT NULL),
CONSTRAINT EMPLOYEE_LNAME_NN CHECK(EMPLOYEE_LNAME IS NOT NULL),
CONSTRAINT EMPLOYEE_SALARY_CK CHECK(EMPLOYEE_SALARY > 900),
CONSTRAINT EMPLOYEE_JOB_NN CHECK(EMPLOYEE_JOB IS NOT NULL),
CONSTRAINT EMPLOYEE_AGE_CK CHECK(EMPLOYEE_AGE > 18),
CONSTRAINT EMPLOYEE_SEX_NN CHECK(EMPLOYEE_SEX IS NOT NULL),
CONSTRAINT EMPLOYEE_PNUMBER_UK UNIQUE(EMPLOYEE_PNUMBER));

CREATE TABLE CUSTOMER(
CUSTOMER_ID VARCHAR(30),
CUSTOMER_FNAME VARCHAR2(30),
CUSTOMER_LNAME VARCHAR2(30),
CUSTOMER_PNUMBER varchar(30),
CONSTRAINT CUSTOMER_ID_PK PRIMARY KEY(CUSTOMER_ID),
CONSTRAINT CUSTOMER_FNAME_NN CHECK(CUSTOMER_FNAME IS NOT NULL),
CONSTRAINT CUSTOMER_LNAME_NN CHECK(CUSTOMER_LNAME IS NOT NULL),
CONSTRAINT CUSTOMER_PNUMBER_UK UNIQUE(CUSTOMER_PNUMBER));

CREATE TABLE ACCUSERS(
USER_UID VARCHAR(30),
USER_PASSWORD VARCHAR(30),
EMPLOYEE_ID VARCHAR(30),
CONSTRAINT USER_UID_PK PRIMARY KEY(USER_UID),
CONSTRAINT USER_PASSWORD_NN CHECK(USER_PASSWORD IS NOT NULL),
CONSTRAINT EMPLOYEE_ID_FK FOREIGN KEY(EMPLOYEE_ID) REFERENCES EMPLOYEES(EMPLOYEE_ID));


CREATE TABLE DISH_FOODS(
FOOD_ID VARCHAR(30),
FOOD_NAME VARCHAR2(40),
FOOD_PRICE NUMBER(10),
CONSTRAINT ORDER_ID_PK PRIMARY KEY(FOOD_ID),
CONSTRAINT FOOD_NAME_NN CHECK(FOOD_NAME IS NOT NULL),
CONSTRAINT FOOD_PRICE_CK CHECK(FOOD_PRICE >= 1));

CREATE TABLE DISH_DRINKS(
DRINK_ID VARCHAR(30),
DRINK_NAME VARCHAR2(30),
DRINK_PRICE NUMBER(10),
CONSTRAINT D_ORDER_ID_PK PRIMARY KEY(DRINK_ID),
CONSTRAINT DRINK_NAME_NN CHECK(DRINK_NAME IS NOT NULL),
CONSTRAINT DRINK_PRICE_CK CHECK(DRINK_PRICE >= 1));

CREATE TABLE ORDERS(
ORDER_ID VARCHAR(30),
CUSTOMER_ID VARCHAR(30),
ORDER_DATE DATE DEFAULT SYSDATE,
ORDER_QUANTITY NUMBER(2),
ORDER_PAYMENT_TYPE VARCHAR2(30),
FOOD_ID VARCHAR(30),
DRINK_ID VARCHAR(30),
CONSTRAINT ORDER_CUSTOMER_ID_PK PRIMARY KEY(ORDER_ID,CUSTOMER_ID),
CONSTRAINT ORDER_QUANTITY_CK CHECK (ORDER_QUANTITY >= 1),
CONSTRAINT ORDER_PAYMENT_TYPE_UK UNIQUE(ORDER_ID,ORDER_PAYMENT_TYPE),
CONSTRAINT ORDER_PAYMENT_TYPE_CK CHECK (ORDER_PAYMENT_TYPE IN ('ONLINE', 'CASH')),
CONSTRAINT CUSTOMER_ID_FK FOREIGN KEY(CUSTOMER_ID) REFERENCES CUSTOMER(CUSTOMER_ID),
CONSTRAINT DISH_ID_FK FOREIGN KEY(FOOD_ID) REFERENCES DISH_FOODS(FOOD_ID),
CONSTRAINT DRINK_ID_FK FOREIGN KEY(DRINK_ID) REFERENCES DISH_DRINKS(DRINK_ID));


CREATE TABLE WAITRESS(
EMPLOYEE_ID VARCHAR(30),
ORDER_ID VARCHAR(30),
WAITRESS_FNAME VARCHAR2(30),
WAITRESS_LNAME VARCHAR2(30),
CONSTRAINT EMPLOYEE_ORDER_ID_PK PRIMARY KEY(EMPLOYEE_ID,ORDER_ID),
CONSTRAINT WAITRESS_FNAME_NN CHECK(WAITRESS_FNAME IS NOT NULL),
CONSTRAINT WAITRESS_LNAME_NN CHECK(WAITRESS_LNAME IS NOT NULL));


CREATE TABLE ONLINEPAYMENT(
O_PAYMENT_ID VARCHAR(30),
OP_GATEWAY VARCHAR2(30),
ORDER_PAYMENT_TYPE VARCHAR2(30),
ORDER_ID VARCHAR(30),
CONSTRAINT O_PAYMENT_ID_PK PRIMARY KEY(O_PAYMENT_ID),
CONSTRAINT OP_GATEWAY_NN CHECK (OP_GATEWAY IS NOT NULL),
CONSTRAINT O_ORDER_PAYMENT_TYPE_CK CHECK (ORDER_PAYMENT_TYPE = 'ONLINE'),
CONSTRAINT O_ID_TYPE_FK FOREIGN KEY(ORDER_PAYMENT_TYPE,ORDER_ID) REFERENCES ORDERS(ORDER_PAYMENT_TYPE,ORDER_ID));

CREATE TABLE CASHPAYMENT(
C_PAYMENT_ID VARCHAR(30),
ORDER_PAYMENT_TYPE VARCHAR2(30),
ORDER_ID VARCHAR(30),
CONSTRAINT C_PAYMENT_ID_PK PRIMARY KEY(C_PAYMENT_ID),
CONSTRAINT C_ORDER_PAYMENT_TYPE_CK CHECK (ORDER_PAYMENT_TYPE = 'CASH'),
CONSTRAINT C_ID_TYPE_FK FOREIGN KEY(ORDER_PAYMENT_TYPE,ORDER_ID) REFERENCES ORDERS(ORDER_PAYMENT_TYPE,ORDER_ID));

/*DROP TABLE*/
DROP TABLE EMPLOYEES;
DROP TABLE CUSTOMER;
DROP TABLE WAITRESS;
DROP TABLE ORDERS;
DROP TABLE ONLINEPAYMENT;
DROP TABLE CASHPAYMENT;
DROP TABLE DISH_FOODS;
DROP TABLE DISH_DRINKS;

